import React from 'react';
import { Btn } from './Button';

class CartList extends React.Component {
    deleteElement(eo) { 
        eo.target.parentNode.removeP(eo.target);
    }

    render() {
        return (
            <section className='cart-list'>
                <div className='container'>
                    <h5>
                        your cart
                    </h5>
                    <div className='light-cart-list'>
                        <div className='box-light-cart-list'>
                            <img src={ this.props.image } alt={ this.props.image } />
                            <span>
                                { this.props.name }
                            </span>
                            <input type={"text"} className="input-counter-cart-list" />
                            <span>
                            { this.props.price }
                            </span>
                            <button className="btn main-btn-remove" onClick={this.deleteElement}>remove</button>
                        </div>
                    </div>
                    <div className='dark-cart-list'>
                        <div className='box-dark-cart-list'>
                            <span>
                                all items
                            </span>
                            <div></div>
                            <span>
                                06
                            </span>
                            <span>
                                $320
                            </span>
                            <Btn classbtn="main-btn-dark-bc" text="check out all"/>
                        </div>
                    </div>
                </div>
            </section>
        );
    }
}

export default CartList;
